import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { createNativeStackNavigator } from '@react-navigation/native-stack';

import HomeScreen from './screens/HomeScreen';
import MoneyDiaryScreen from './screens/MoneyDiaryScreen';
import EducationScreen from './screens/EducationScreen';
import RecommendationScreen from './screens/RecommendationScreen';
import ProfileScreen from './screens/ProfileScreen';

import AddIncome from './screens/diary/AddIncome';
import AddExpense from './screens/diary/AddExpense';
import Transactions from './screens/diary/Transactions';

const Tab = createBottomTabNavigator();
const Stack = createNativeStackNavigator();

function HomeStack() {
  return (
    <Stack.Navigator screenOptions={{ headerShown: false }}>
      <Stack.Screen name="HomeMain" component={HomeScreen} />

      {/* These 3 were missing â€” adding now */}
      <Stack.Screen name="AddIncome" component={AddIncome} />
      <Stack.Screen name="AddExpense" component={AddExpense} />
      <Stack.Screen name="Transactions" component={Transactions} />
    </Stack.Navigator>
  );
}

export default function App() {
  return (
    <NavigationContainer>
      <Tab.Navigator screenOptions={{ headerShown: false }}>
        <Tab.Screen name="Home" component={HomeStack} />
        <Tab.Screen name="Diary" component={MoneyDiaryScreen} />
        <Tab.Screen name="Education" component={EducationScreen} />
        <Tab.Screen name="Recommend" component={RecommendationScreen} />
        <Tab.Screen name="Profile" component={ProfileScreen} />
      </Tab.Navigator>
    </NavigationContainer>
  );
}
